import React, { Component } from 'react';
import './ColorBox.css';


class ColorBox extends Component {
    render () {
        const {name, background} = this.props;
        return (
            <div style={{ background }} className="ColorBox">
                <span>{name}</span>
                <span>Home</span>
            </div>
        );
    }
}

export default ColorBox;
